func ytdlCheck() {
	location, err := exec.LookPath("youtube-dl")
	if err != nil {
		log.Printf("Could not find youtube-dl {%s}\n\t\t    You can install with pip , or your package manager (apt,pacman,dnf etc) { youtube-dl }", err.Error())
		os.Exit(2)
	}
	log.Println("Using youtube-dl on", location)

}
